Cheshire & Warrington Local Enterprise Partnership (The LEP) is looking to appoint consultants to work with the LEP, local authorities and other subregional partners to refresh, consolidate and reframe our economic strategy to ensure it meets our new sustainable and inclusive growth vision, is effective, compelling, will maximise investment, and deliver our wider economic priorities for people, businesses and places.

The subregion has a significant local evidence base developed over several years and recently refreshed in 2022. It has built on our Strategic Economic Plan (SEP), Local Industrial Strategy (LIS), the LEP Recovery Plan (2021-22) and the Plans of our three local authorities. We have recently refreshed our evidence base in 2022 to take account of the recent changes to the external environment such as Covid, EU exit, Net Zero, Levelling Up and other government policies, and our new vision for healthy, sustainable and inclusive growth. 

Under the commission the Consultants will:

•	Review the recently completed evidence base update.
•	Review/evaluate progress to date against existing subregional strategic plans (mainly SEP, LIS, Recovery Plan)
•	Engage with our three local authority partners to undertake a desktop review of local economic and associated strategies (each area's key strategies as a minimum) regarding alignment on the subregional sustainable and inclusive economic priorities;
•	Develop an initial think piece for the LEP on potential approaches to developing a more proactive, innovative, sustainable and inclusive economic plan for Cheshire and Warrington, with a review of the levers and powers at the area's collective disposal (existing and potential);
•	Work with the LEP, local authorities and key stakeholders to translate headline priorities into areas where intervention might be required to build on successes or address weaknesses, and improve resilience, aligned to local and national priorities;
•	Development of supporting presentation material related to key economic, growth and sectoral messages, within the lens of sustainable and inclusive growth, and inclusion of any additional meta data/technical annexes, maps/databases where relevant;
•	Advice/proposal on targets/KPI's that could be used to monitor progress on the delivery of the sustainable and inclusive economic plan. 

The closing date and time for the receipt of submissions and all requested documentation relating to this stage is 16:00 hours (4pm) on 1st December 2022. Late submissions will not be accepted. 

Submissions will only be accepted if they are returned via email to tenders@cheshireandwarrington.com Bidders should not send their completed submissions to/copy in any other email address.

Wattisham - D&W replacements to up to 148 properties

Amey have been tasked by the Defence Infrastructure Organisation through the Future Defence Infrastructure Service to deliver the Regional Accommodation Maintenance Service for the Central and North Regions.
For Amey to accept any Expression of Interest it is ESSENTIAL that any subcontractor is:
- a member of Constructionline at GOLD LEVEL 3;
- capable of working to MOD SFG20 (Pre-Planned Maintenance);
- capable of working in a Building Information Management (BIM) Level 2 environment;
- compliant with DefStan 05-138 (required if you are likely to handle MoD Identifiable Information on your IT system);
- willing to work with Amey to deliver Social Value to our Client.
DESIRABLE attributes of our Supply Chain:
- have a Corporate Social Responsibility policy;
- have a Business Continuity and Disaster Recovery Plan
If successful the subcontractor will need to pass a pre-qualification questionnaire, sign up to Amey Terms and Conditions, and meet the MoD Security Requirements. 
This advert is for Expressions of Interest (BY EMAIL ONLY) - from the responses and our existing subcontractor data base we shall compile the tender list. Tender packs will follow separately.
Note 1: The bidder must quote for all aspects of the Works.
Note 2: Future works of a similar nature may be negotiated based upon submitted rates.
Note 3: To comply with The Public Contract Regulations 2015, those making an Expression of Interest may be required to sign-up to our 'Sub-contract Agreement' where 'Mini Competitions' or 'Call Offs' may be used to tender works/services.

